    let navigate = useNavigate();
    const [second, setSecond] = useState(3);
    useEffect(() => {
        let timer = setInterval(() => {
            console.log(second);

            if (second === 0) {
                navigate('/home', { replace: true })
                clearInterval(timer);
            }
            setSecond(second-1);
            console.log(second);

        }, 1000)
    }, [])

    return (
        <h3>{second}秒后返回主页....</h3>
    )
}
